import React from "react";

import "../MenuList/MenuList.scss";

export default function MenuList(props) {
    return (
        <ul className={props.class}>
            <li className="navigation__item">
                <a className="navigation__link navigation__link--active" href="#intro">Home</a>
            </li>
            <li className="navigation__item">
                <a className="navigation__link" href="#products">Products</a>
            </li>
            <li className="navigation__item">
                <a href="#" className="navigation__link" >Faqs</a>
            </li>
            <li className="navigation__item">
                <a href="#" className="navigation__link">Contact us</a>
            </li>
        </ul>
    )
}
